import React from 'react';

function PeopleList({ people, onContact }) {
  return (
    <div>
      <h2>People List</h2>
      {people.length === 0 ? (
        <p>No people found for this zip code.</p>
      ) : (
        <table border="1" cellPadding="10">
          <thead>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Phone</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {people.map((person) => (
              <tr key={person.id}>
                <td>{person.first_name} {person.last_name}</td>
                <td>{person.email}</td>
                <td>{person.phone}</td>
                <td>
                  <button onClick={() => onContact(person.email, 'A')}>Contact A</button>
                  <button onClick={() => onContact(person.email, 'B')}>Contact B</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default PeopleList;
